import logo from './logo.svg';
import './App.css';
import { useState } from 'react';


function App() {
  const [formState, setFormState] = useState({
    email: '',
    phoneNumber: '',


  });
  return (
    <div className="container" style={{marginTop: '40px'}}>

      <div className='col-6 mx-auto card card-body'>
      <h5 className='text-center'>Purple Signature Generator</h5>
      <div class="form-group">
        <label for="exampleInputEmail1">Name</label>
        <input type="email" name='email' class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Name"/>
      </div>

      <div class="form-group">
        <label for="exampleInputEmail1">Job Designation</label>
        <input type="email" name='email' class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Enter email"/>
      </div>

      <div class="form-group">
        <label for="exampleInputEmail1">Official Email address</label>
        <input type="email" name='email' class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Enter email"/>
      </div>
      <div class="form-group">
        <label for="exampleInputPassword1">Phone Number 1</label>
        <input type="text" name='phoneNumber1' class="form-control" id="exampleInputPassword1" placeholder="Phone"/>
      </div>

      <div class="form-group">
        <label for="exampleInputPassword1">Phone Number 2</label>
        <input type="text" name='phoneNumber2' class="form-control" id="exampleInputPassword1" placeholder="Phone"/>
      </div>

      <button type="submit" class="btn btn-primary">Submit</button>

    </div>
    </div>
  );
}

export default App;
